ute; se a funcionalidade permite a correta consolida&ccedil;&atilde;o das cargas, garantindo que todas as informa&ccedil;&otilde;es, como valores, prazos e detalhes da transportadora, sejam atualizadas de forma adequada.</li>\r\n</ul>\r\n','<ul>\r\n	<li>A aplica&ccedil;&atilde;o deve estar acess&iacute;vel em&nbsp;<a href=\"https://transporter.azship.com.br/\" onclick=\"window.open(this.href, \'\', \'resizable=no,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=no\'); return false;\" rel=\"noopener noreferrer\" tabindex=\"0\">https://transporter.azship.com.br/</a></li>\r\n	<li>O usu&aacute;rio deve estar autenticado no portal do transportador.</li>\r\n	<li>Ter duas ou mais Carga Lote lan&ccedil;ada conforme cen&aacute;rio&nbsp;<strong><a href=\"http://azship/testlink/linkto.php?tprojectPrefix=AZS&amp;item=testcase&amp;id=AZS-28\" onclick=\"window.open(this.href, \'\', \'resizable=no,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=no\'); return false;\">AZS-28</a>.</strong></li>\r\n	<li>Ter as&nbsp;cargas aceitas pelo Transportador, conforme cen&aacute;rio de teste <strong><a href=\"http://azship/testlink/linkto.php?tprojectPrefix=AZS&amp;item=testcase&amp;id=AZS-50\">AZS-50.</a></strong></li>\r\n	<li>No painel de cargas, as cargas estar&atilde;o na coluna &quot;<a href=\"http://azship/testlink/lib/attachments/attachmentdownload.php?id=567\" onclick=\"window.open(this.href, \'\', \'resizable=no,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=no\'); return false;\"><strong>Aguardando Coleta</strong></a>&quot;.</li>\r\n</ul>\r\n',1,2,'2025-03-10 20:51:23',2,'2025-03-10 19:04:22',1,1,1,10.00);
